import { Button, Typography } from "@mui/material";

import BasicTimeline from "../Timeline/Timeline";

import './Profile.css';

export default function Profile() {

    return(
        <div className="profile container">
            <div className="profile_name">
                <Typography className="name">Saidur Rahman</Typography>
                <Typography className="title">Full Stack Developer</Typography>
            </div>

            <figure className="profile_image">
                <img src={require('../../assets/images/img2.jpeg')} alt="Profile" />
            </figure>

            <div className="profile_details">
                <BasicTimeline />
                <br />
                <Button>Download Resume</Button>
            </div>
        </div>
    );

}
